package com.po;



public class Colleage {
	private int cid;
	private String cname;
	public Colleage() {
		super();
		// TODO Auto-generated constructor stub
	}
	public Colleage(int cid, String cname) {
		super();
		this.cid = cid;
		this.cname = cname;
	}
	public int getCid() {
		return cid;
	}
	public void setCid(int cid) {
		this.cid = cid;
	}
	public String getCname() {
		return cname;
	}
	public void setCname(String cname) {
		this.cname = cname;
	}
	


	
	

}
